    public class CryptoVisionFileProxy_TestSequenceFileIo
    {
        private const string TimeAdminName = "TimeAdmin";
        private static readonly byte[] TimeAdminPin = Encoding.UTF8.GetBytes("22222222");

        [Fact]
        public async Task SeStartAsync()
        {
            var testSequenceFileIo = new TestSequenceFileIo(
                new List<TestSequenceItem>()
                {
                new TestSequenceItem(0, TestSequenceItemDirection.Write, ""),
                new TestSequenceItem(1, TestSequenceItemDirection.Read, ""),
                new TestSequenceItem(2, TestSequenceItemDirection.Write, ""),
                new TestSequenceItem(3, TestSequenceItemDirection.Read, ""),
                new TestSequenceItem(4, TestSequenceItemDirection.Read, ""),
                new TestSequenceItem(5, TestSequenceItemDirection.Read, "")
            });

            var config = new CryptoVisionConfiguration
            {
                DevicePath = string.Empty,
                TseIOTimeout = 100,
                TseIOReadDelayMs = 0
            };
            var transportAdapter = new MassStorageClassTransportAdapter(Mock.Of<ILogger<MassStorageClassTransportAdapter>>(), testSequenceFileIo, config);

            var sut = new CryptoVisionFileProxy(transportAdapter);

            (var result, var deviceFirmwareId, var deviceUniqueId) = await sut.SeStartAsync();

            result.ThrowIfError();
            deviceFirmwareId.Should().Be("462076 Dec 18 2019 00:11:50");
            Convert.ToBase64String(deviceUniqueId).Should().Be("AQPQR/UAG4VZ78f1qvVMZw==");
        }

        [Fact]
        public async Task SeUpdateTimeAsync()
        {
            var testSequenceFileIo = new TestSequenceFileIo(
                new List<TestSequenceItem>()
                {
                    //start-sequence
                    new TestSequenceItem(0, TestSequenceItemDirection.Write, ""),
                    new TestSequenceItem(1, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(2, TestSequenceItemDirection.Write, ""),
                    new TestSequenceItem(3, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(4, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(5, TestSequenceItemDirection.Read, ""),

                    //authenticate, update-time, logout
                    new TestSequenceItem(6, TestSequenceItemDirection.Write, ""),
                    new TestSequenceItem(7, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(8, TestSequenceItemDirection.Write, ""),
                    new TestSequenceItem(9, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(10, TestSequenceItemDirection.Write, ""),
                    new TestSequenceItem(11, TestSequenceItemDirection.Read, ""),
                });


            var config = new CryptoVisionConfiguration
            {
                DevicePath = string.Empty,
                TseIOTimeout = 100,
                TseIOReadDelayMs = 0
            };
            var transportAdapter = new MassStorageClassTransportAdapter(Mock.Of<ILogger<MassStorageClassTransportAdapter>>(), testSequenceFileIo, config);

            var sut = new CryptoVisionFileProxy(transportAdapter);

            (var result, var deviceFirmwareId, var deviceUniqueId) = await sut.SeStartAsync();

            result.ThrowIfError();
            deviceFirmwareId.Should().Be("462076 Dec 18 2019 00:11:50");
            Convert.ToBase64String(deviceUniqueId).Should().Be("AQPQR/UAG4VZ78f1qvVMZw==");

            await sut.SeAuthenticateUserAsync(TimeAdminName, TimeAdminPin);

            var unixTime = new DateTime(2020, 05, 17, 14, 0, 0, DateTimeKind.Utc).ToTimestamp();

            (await sut.SeUpdateTimeAsync()).ThrowIfError();

            await sut.SeLogOutAsync(TimeAdminName);

        }


