                    // update-time, abort-read
                    new TestSequenceItem(6, TestSequenceItemDirection.Write, ""),
                    new TestSequenceItem(7, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(8, TestSequenceItemDirection.Write, ""),
                });

            var config = new CryptoVisionConfiguration
            {
                DevicePath = string.Empty,
                TseIOTimeout = 100,
                TseIOReadDelayMs = 0
            };
            var transportAdapter = new MassStorageClassTransportAdapter(Mock.Of<ILogger<MassStorageClassTransportAdapter>>(), testSequenceFileIo, config);

            var sut = new CryptoVisionFileProxy(transportAdapter);

            (var result, var deviceFirmwareId, var deviceUniqueId) = await sut.SeStartAsync();

            result.ThrowIfError();
            deviceFirmwareId.Should().Be("462076 Dec 18 2019 00:11:50");
            Convert.ToBase64String(deviceUniqueId).Should().Be("AQPQR/UAG4VZ78f1qvVMZw==");


            var unixTime = new DateTime(2020, 05, 17, 14, 0, 0, DateTimeKind.Utc).ToTimestamp();


            result = await sut.SeUpdateTimeAsync();

            //Assert.Throws<CryptoVisionException>(() => result.ThrowIfError());

            var exception = Record.Exception(() => result.ThrowIfError());
            Assert.NotNull(exception);
            Assert.IsType<CryptoVisionException>(exception);


        }




        [Fact]
        public async Task SeExportDataAsync()
        {
            var testSequenceFileIo = new TestSequenceFileIo(
                new List<TestSequenceItem>()
