                    //start-sequence
                    new TestSequenceItem(0, TestSequenceItemDirection.Write, ""),
                    new TestSequenceItem(1, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(2, TestSequenceItemDirection.Write, ""),
                    new TestSequenceItem(3, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(4, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(5, TestSequenceItemDirection.Read, ""),

                    //export-data
                    new TestSequenceItem(6, TestSequenceItemDirection.Write, ""),
                    new TestSequenceItem(7, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(8, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(9, TestSequenceItemDirection.Write, ""),
                    new TestSequenceItem(10, TestSequenceItemDirection.Read, ""),
                    new TestSequenceItem(11, TestSequenceItemDirection.Write, ""),
                    new TestSequenceItem(12, TestSequenceItemDirection.Read, ""),
                });

            var testSequenceExportLength = 19968;
            var testSequenceExportFiles = new string[]{
                "info.csv",
                "4a3f03a2dec81878b432548668f603d14f7b7f90d230e30c87c1a705dce1c890_X509.cer",
                "1be2096d73eeb9bcbb2a1be6fb9925e1cd3c44180d88111e5e6061ffa32c0da7_X509.cer",
                "34e9dbdea9fadf71a3bf5402fc47590739e508eb2031758514d897cb7db99cd2_X509.cer",
                "Unixt_1589712778_Sig-713_Log-Sys_LogOut.log",
                "Unixt_1589712778_Sig-714_Log-Aud.log",
                "Unixt_1589712778_Sig-715_Log-Sys_AuthenticateUser.log",
                "Unixt_1589712808_Sig-716_Log-Sys_UpdateTime.log",
                "Unixt_1589712808_Sig-717_Log-Sys_LogOut.log",
                "Unixt_1589712808_Sig-718_Log-Aud.log",
                "Unixt_1589712808_Sig-719_Log-Aud.log",
                "Unixt_1589712809_Sig-720_Log-Sys_AuthenticateUser.log",
                "Unixt_1589724498_Sig-721_Log-Sys_UpdateTime.log",
                "Unixt_1589724498_Sig-722_Log-Sys_LogOut.log",
                "Unixt_1589724498_Sig-723_Log-Aud.log",
