                (await sut.SeExportDataAsync(stream, string.Empty)).ThrowIfError();

                stream.Length.Should().Be(testSequenceExportLength);
                var fileList = new List<string>();

                stream.Position = 0;
                using (var reader = ReaderFactory.Open(stream))
